	// Complete the solve function below.
	static long[] solve(String s, long[] queries) {
		List<String> palArr = findPalindromes(s);
		palArr = palArr.stream().sorted().collect(Collectors.toList());
//		System.out.println(palArr.toString());
		for (int i = 0; i < palArr.size(); i++) {
			System.out.println(i + " - " + palArr.get(i));
		}
		long[] results = new long[queries.length];
		for (int i = 0; i < queries.length; i++) {
			if (queries[i] <= palArr.size()) {
				results[i] = calculateSum(palArr.get((int) (queries[i] - 1)));
				System.out.println(queries[i] + "\t" + palArr.get((int) (queries[i] - 1)) + "\t" + results[i]);
			} else {
				results[i] = -1;
				System.out.println(queries[i] + "\t" + results[i]);
			}
		}
		return results;
	}

	static Map<String, BigInteger> calcMap = new HashMap<>();
	static String a = "100001";

	static int calculateSum(String str) {
		BigInteger sum = BigInteger.ZERO;
		for (int i = 0; i < str.length(); i++) {
			BigInteger pow = null;
			if (calcMap.containsKey(a + (str.length() - i - 1))) {
				pow = calcMap.get(a + (str.length() - i - 1));
			} else {
				pow = new BigInteger(a).pow(str.length() - i - 1);
				calcMap.put(a + (str.length() - i - 1), pow);
			}

			BigInteger ascii = new BigInteger(String.valueOf(str.charAt(i) - '\0'));
//			 System.out.println(ascii + "*" + pow);
			BigInteger mul = ascii.multiply(pow);
			sum = sum.add(mul);
		}
		return sum.mod(new BigInteger("1000000007")).intValue();
	}

	static List<String> findPalindromes(String str) {
		int pos = 0;
		List<String> palArr = new ArrayList<>();
		while (pos != str.length()) {
			palArr.add(String.valueOf(str.charAt(pos)));
			if (0 < pos) {
				for (int i = pos - 1; i >= 0; i--) {
					String x = str.substring(i, pos);
					if ((pos + pos - i + 1) <= str.length()) {
						String y = str.substring(pos + 1, pos + pos - i + 1);
						y = reverseIt(y);
						if (x.equals(y)) {
							palArr.add(str.substring(i, pos + pos - i + 1));
						}
					}
				}
			}
			if (pos < str.length() - 1) {
				char bas = str.charAt(pos);
				for (int i = pos + 1; i < str.length(); i++) {
					if (bas == str.charAt(i)) {
						String dup = str.substring(pos, i + 1);
						// System.out.println(dup);
						if (dup.length() % 2 == 0) {
							palArr.add(dup);
						}
					} else {
						break;
					}
				}
			}
			pos++;
		}
		return palArr;
	}

	public static String reverseIt(String source) {
		int i, len = source.length();
		StringBuilder dest = new StringBuilder(len);

		for (i = (len - 1); i >= 0; i--) {
			dest.append(source.charAt(i));
		}

		return dest.toString();
	}
